import React from 'react';



import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Navbar, NavbarBrand } from 'react-bootstrap';

function App() {
  return (
    <Navbar bg='light'>
      <NavbarBrand>Joshua Coleman</NavbarBrand>
    </Navbar>
  );
}

export default App;
